import React, { Component } from "react";

 
class Home extends Component {
  render() {
    return (
      <div className=" float-lg-right float-md-right float-sm-right  copybody">
        
      <h3 className="Title">Tom Terracino</h3>
      <img className="img-fluid max-width: 100%" src="images/backgroundimage.png" ></img>
      
      <a href="https://chrome.google.com/webstore/detail/url-defense-point-remover/icchicahlfonnpnadgfmplnapcjoghfp">URL Defense Proofpoint Link</a>
      </div>
    );
  }
}
 
export default Home;
